import {useEffect,useState} from "react";
import axios from "axios";

export function WatherAPIdata(){

  //const [category, setCategory] =useState([]);
  const [product, setProduct]= useState([{id:0,category:'', title:'',discription:'',image:'',price:0,rating:{rate:0,count:0}}]);

  //  function LoadCategory() {
  //    axios.get(/*'https://fakestoreapi.com/products/categories'*/`https://api.jsonbin.io/v3/b/68f1a874d0ea881f40a737dd`)
  //    .then(response=>{
  //      // if you want to add any now elemrnt
  //     response.data.unshift('all');
  //     setCategory(response.data);
  //    })
    
  //    }

     function LoadProduct(url) {
      axios.get(url).then(response=>{
        //setProduct(response.data);
        setProduct(response.data.record);
      })
     }
   

   

  useEffect(() =>{
      //LoadCategory();
     //LoadProduct('https://fakestoreapi.com/products');
    LoadProduct(`https://api.jsonbin.io/v3/b/68f196a6d0ea881f40a7276c`); // my api 
  },[])


  return(
    
         <div>

      
          <section className="mt-4 row">
        

         <main className="col-10 d-flex flex-wrap overflow-auto" style={{height:'500px'}}>

         {
          product.map(prod=>
            <div className="card p-2 m-2" style={{width:'200px'}}>
              <img src={prod.image} className="card-img-top" height="120px"/>
              <div className="card-header" style={{height:'120px'}}>
                <div>
                  { prod.title }
                </div>
              </div>
             <div className="card-body">
                <dl>Price</dl>
                <dd>{prod.price}</dd>
                <dl>Reating</dl>
                <dd>
                  {
                    <span className="badge bg-success p-1 rounded">{prod.rating.rate}<span className="bi bi-star-fill"></span> <span className="text-secondary fw-bold">{prod.rating.count}</span></span>
                  }
                </dd>
             </div>
             <div className="card-footer">
              <button className="btn btn-warning bi bi-cart-dash w-100">Add to Card</button>
             </div>
            </div>
          )
         }

         </main>

        </section>

    </div>
  )
}
